import React from 'react';
import './About.css'; 
import Info from '../components/Getintouch';
import Footer from '../components/Footer';
import { FaCheck } from 'react-icons/fa';
import { FaCircle } from 'react-icons/fa'; 



const About = () => {


  const images = [
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ2Jn_FPFc74Nlq9c47RcPPOWU8usR3plZ1lA&usqp=CAU',
    'data:image/jpeg;base64,',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSVsR7DY7kcl2c1FUTz1uE5P0mmOUPvfeJ7hQ&usqp=CAU',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTpmS5IAS6i9BrMMh3UW-u8YW-Um05BXuqL-Q&usqp=CAU',
  ];
  return (
    <div className="about-container">
      <div class="bg">
      <img
       
        className="background-image"
      />
      <div className="text-overlay">
        <h1>HOME-ABOUT US</h1>
      </div>
      </div>
      <div className="container">
          <div className="column">
           
            
            <div>
            
            <h2>WHAT WE DO</h2>
            
      <p><FaCheck className="tick-icon" /> Our main product consists of different grades of talc which are used in different industries..</p>
      <p><FaCheck className="tick-icon" /> We also provide various qualities and forms of fluorite to our customers..</p>
      <p><FaCheck className="tick-icon" /> We mine different variations of chromite from our company owned mountains.</p>
    </div>
          
          </div>
          
    
          <div className="column">
          <div className="vertical-separator"></div>
            <div>
            <h2>BUSINESS PLAN MARKET
</h2>
            <p>As a leading Talc Manufacturer, we have one of the largest business market share locally and have also made our mark in the international market. Our aim is to</p>
            <div>
      <p><FaCheck className="tick-icon" /> Lower our cost of production through use of latest equipment and with large scale of operation reducing cost and to help us to maintain strict quality requirements of our customers.</p>
      <p><FaCheck className="tick-icon" /> Produce the best product, cause no unnecessary harm, use business to inspire and implement solutions to the environmental crisis and work for the well being of the local population.</p>
      <p><FaCheck className="tick-icon" />Ensures uninterrupted production and timely supplies to our clients..</p>
    </div>
          </div>
        </div>
        </div>
     
        
     
      <div className="heading-container">
        <h1>PRODUCTS WE DELIVER  ALL <br/> OVER THE WORLD
</h1>
        <FaCircle className="separator" />
      </div>

      
     
      <div className="image-gallery">
      {images.map((image, index) => (
        <div key={index} className="image-item">
          <img src={image} alt={`Image ${index + 1}`} />
        </div>
      ))}
    </div>
    
    
        <Info />
<Footer />
     
    </div>
    
  )
};

export default About;
